import React from "react";

class InputSearchComponent extends React.Component {

  handleChange(e) {
    this.props.onInputChange(e.target.value);
  }

  render() {
    return (
      <div className="InputSearchComponent">
        <form className="form-inline">
          <div className="md-form form-lg">
            <input
              value=""
              onChange={this.handleChange}
              type="text"
              id="inputLGEx"
              className="form-control form-control-lg"
            />
            <label htmlFor="inputLGEx">Search</label>
          </div>
          <button type="button" onClick={this.props.doWhatever} className="btn btn-primary btn-md mt-0">
          {this.props.title}
          </button>
        </form>
      </div>
    );
  }
}

export default InputSearchComponent;
